/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `hire_agreement_AFTER_INSERT` AFTER INSERT ON `hire_agreement` FOR EACH ROW BEGIN
